import React from 'react'



export default class Container extends React.Component {
    static async getInitialProps() {
        // console.log('test test 22333', this.props)
        const defaultProps = {
            title: (!this.props.title ? "test" : this.props.title),
            // backgroundImage: (!this.props.backgroundImage ? "https://mdbootstrap.com/img/Photos/Others/architecture.jpg" : this.props.backgroundImage),
        }

        return {'test': defaultProps}
    }

    render () {
        return (
            <div className="jumbotron" style={{backgroundImage: `url('${this.props.backgroundImage}')`, color: '#000000'}}>
                <div className="container">
                    <h2 className="display-3 text-center">{ this.props}</h2>
                </div>
            </div>
        )
    }
}
